import { StyleSheet} from 'react-native';


const stylesLogin = StyleSheet.create({
    login:{
        backgroundColor: '#222222',
        width: '100%',
        height: '100%'
    },
    textinputUser:{
        borderColor: 'grey',
        borderWidth: 2,
        width: '60%',
        alignSelf: 'center',
        borderRadius: 3,
        marginTop: '12%',
        fontFamily: 'Roboto-Regular'
    },
    textinputPassword:{
        borderColor: 'grey',
        borderWidth: 2,
        marginTop: '10%',
        width: '60%',
        alignSelf: 'center',
        borderRadius: 3,
        fontFamily: 'Roboto-Regular',
        marginBottom: '15%'
    },
    logo:{
        resizeMode: 'contain',
        aspectRatio: 1.75,
        alignSelf: 'center',
        marginTop: '45%'
    },
    brand:{
        textAlign: 'center',
        alignSelf: 'center',
        marginTop:'3%',
        fontSize: 30,
        fontFamily: 'Raleway-Light'
    },
    buttonLogin:{
        fontFamily: 'Raleway-Medium',
        width:'70%',
        alignSelf: 'center'
    },
});

export default stylesLogin;
